import Button from "../button/button";
import { useState } from "react";

const Add = () => {
    const [number, setNumber] = useState(0)
    const increase = () => {
        setNumber(number => number + 1)
    }

    return(
        <div>
            {number}
            <Button btnText = 'Increase' click = {increase} />
        </div>
    )
}

export default Add;
